<template>
	<view class="page-body">
		<page-head title="movable-view"></page-head>
		<view class="uni-padding-wrap uni-common-mt">

			<movable-area v-bind:style="[{ width: screenSize.width + 'px', height: screenSize.height + 'px' }]">
				<movable-view @tap="bakcgrounImgTap" direction="all" out-of-bounds class="bg-img" inertia>手机背景图片</movable-view>
				<movable-view 
					v-for="(item, itemIndex) in viewList" 
					@change="onChange"
					:key="itemIndex" 
					@tap="tap(item,itemIndex,this)" 
					v-bind:class="[item.isActive ? 'activeClass' : '', item.defaultClass]" 
					:x="item.x"
					:y="item.y"
					scale
					scale-min="0.25" 
					scale-max="4" 
					:scale-value="item.scale"   
					direction="all" 
					out-of-bounds inertia>
					<cover-image v-if="item.type=='img'" :src="item.src" @error="imageError" @tap.stop="chooseImage(itemIndex)"></cover-image>
					<text class="singer" v-if="item.content" @tap.stop="tapText(item)">{{item.content}}</text>
				</movable-view>
			</movable-area>
			<uni-popup :show="textStyle" type="bottom" @hidePopup="hiddenPopup('text')">
				<view class="action-row">
						<input type="text" confirm-type="完成" class="uni-input" v-model="inputValue.content" maxlength="10" focus=true />
				</view>
			</uni-popup>
			<uni-popup :show="popupStyle" type="bottom" @hidePopup="hiddenPopup('model')">
				<view class="action-row">
					<view style="flot:left;display: inline-block;" class="image-item" v-for="(item,index) in imgarray" :key="index">
						<view class="image-content" @tap="arrowButton(item.type)">
							<cover-image style="width: 30px; height: 30px;" :mode="item.mode" :src="item.src" @error="imageError"></cover-image>
						</view>
						<view class="image-title" style="font-size:9px;text-align:center;">{{item.text}}</view>
					</view>
				</view>
			</uni-popup>
		</view>
	</view>
</template>

<script>
import uniPopup from "@/components/uni-popup.vue"
	export default {
		components: {uniPopup},
		data() {
			return {
				popupStyle:false,
				textStyle:false,
				imgarray:[
					{
						mode:'scaleToFill',
						src:'data:image/png;base64,',
						text:'上调',
						type:'up',
					},
					{
						mode:'scaleToFill',
						src:'data:image/png;base64,',
						text:'下调',
						type:'down',
					},
					
					{
						mode:'scaleToFill',
						src:'data:image/png;base64,',
						text:'左调',
						type:'left',
					},
					{
						mode:'scaleToFill',
						src:'data:image/png;base64,',
						text:'右调',
						type:'right',
					},
					{
						model:'scaleToFill',
						src:'data:image/png;base64,',
						text:'放大',
						type:'zoomMax',
					},
					{
						model:'scaleToFill',
						src:'data:image/png;base64,',
						text:'缩小',
						type:'zoomMin',
					},
				],
				viewList:[
					{
						x:0,
						y:0,
						scale:1,
						defaultClass:'avater',
						isActive:false,
						content:'',
						type:'img',
						src:'../../../static/logo.png',
					},
					{
						x:0,
						y:0,
						scale:1,
						isActive:false,
						defaultClass:'signature',
						content:'个性签名'
					},
				],
				old: {},
				screenSize:{
					width:'',
					height:'',
				},
				selectSector:'',
				inputValue:{},
				tempFilePath: '',
				savedFilePath: ''
			}
		},
		onHide(){
			uni.setStorageSync('viewList',this.viewList);
		},
		onShow(){
			let that = this;
			uni.getStorage({
				key: 'viewList',
				success: function (res) {
					that.viewList = res.data;
				},
				fail:function(res){
					
				}
			});
		},
		onLoad(){
			this.screenSize.width = uni.getSystemInfoSync().screenWidth;
			this.screenSize.height = uni.getSystemInfoSync().screenHeight-65;
		},
		methods: {
			chooseImage(v) {
				let that = this;
				uni.chooseImage({
					count: 1,
					success: (res) => {
						that.tempFilePath = res.tempFilePaths[0];
						//console.log(that.viewList[v]);
						//that.viewList[v].src = res.tempFilePaths[0];
						
					}
				});
			},
			arrowButton:function(type){
				switch(type){
					case 'up':
					this.$nextTick(function() {
						this.viewList[this.selectSector].y = this.old.y-1;
					})
					break;
					case 'down':
					this.$nextTick(function() {
						this.viewList[this.selectSector].y = this.old.y+1;
					})
					break;
					case 'left':
						this.viewList[this.selectSector].x = this.old.x-1;
					break;
					case 'right':
						this.viewList[this.selectSector].x = this.old.x+1;
					break;
					case 'zoomMax':
					this.viewList[this.selectSector].scale = this.old.scale+0.25;
					break;
					case 'zoomMin':
					this.viewList[this.selectSector].scale = this.old.scale-0.25;
					break;
				}
			},
			hiddenPopup(type){
				if(type=='text'){
					this.textStyle = false;
				}else{
					this.popupStyle = false;
				}
				
			},
			bakcgrounImgTap:function(){
				this.$nextTick(function() {
					this.viewList.forEach(function(item,index){
						item.isActive = false;
					});
				});
			},
			tap: function(e,accindex,ele) {
				let that = this;
				that.$nextTick(function() {
					that.viewList.forEach(function(item,index){
						if(accindex == index){
							that.popupStyle = true;
							item.isActive = true;
							that.selectSector = accindex;
							that.old = e;
						}else{
							item.isActive = false;
						}
					});
				});
			},
			tapText:function(v){
				
				this.inputValue = v;
				console.log(this.inputValue.content);
				this.textStyle = true;
			
			},
			onChange: function(e) {
				let that = this;
				
				setTimeout(function(){
					that.old.x = e.detail.x
					that.old.y = e.detail.y
				},3000);

			},
		}
	}
</script>

<style>
	
	
	@font-face{
     font-family: 'HYChenMeiZiF'; 
     src: url(data:font/truetype;charset=utf-8;base64,) format('truetype');
     }
	.bg-img{
		height: 100%;
		width: 100%;
		background-color: #4CD964;
		color: #fff;
	}

	.avater{
		width:300upx;
		height: 300upx;
	}
	.singer{
		font-family: "HYChenMeiZiF";
		font-size: 60upx;
	}
	.signature{
		
		width:300upx;
		height: 200upx;
		background-color: #007AFF;
		color: #fff;
	}
	movable-view {
		display: flex;
		align-items: center;
		justify-content: center;
		height: 150upx;
		width: 150upx;
		
		color: #fff;
	}

	movable-area {
		
		width: 100%;
		background-color: #D8D8D8;
		overflow: hidden;
	}
	.action-row{
		margin-top:22upx;
		display: flex;
		flex-direction: row;
		align-content: space-between;
		justify-content: space-around;
	}
	.activeClass{
		border:1px solid #FF3333;
	}

</style>